Прямой работодатель #Продавцы #Консультанты
#Работа #Москва
⠀
Розничная компания модной одежды, обуви и аксессуаров люксовых брендов.. На текущий момент по всей России у нас открыто более 180 магазинов. Среди наших марок - Burberry, DKNY, Juicy Couture, Marc O’Polo, New Balance, Timberland.
⠀
В связи с открытием новых бутиков мы ищем продавцов-консультантов в нашу команду.
⠀
Мы предлагаем:
Дружный молодой коллектив и адекватное руководство;
Престижная работа в стабильной, развивающейся компании;
Обучение за счет компании;
Большие скидки на товары компании;
Высокий уровень заработной платы (оклад +процент);
Карьерный рост;
График 5/2, плавающие выходные;
Оформление ТК РФ.
⠀
Чем предстоит заниматься?
Предоставление клиентского сервиса класса люкс по стандартам компании;
Выполнение планов продаж;
Осуществление выкладки продукции компании в магазине;
Быть в курсе последних тенденций модной индустрии.
⠀
Мы ждём тех, кто:
Хочет работать и зарабатывать;
Имеет активную жизненную позицию;
Готов обучаться;
Умеет работать в команде;
Нацелен на результат;
⠀
Опыт работы в продажах желателен, но не обязателен.
Место работы: тц Рига Молл или ТЦ Рига Outlett Village
⠀
